    public static boolean hasGroupsSizeX(int[] deck) {

        Map<Integer, Integer> map = Arrays.stream(deck)
                                          .boxed()
                                          .collect(Collectors.toMap(k -> k, v -> 1, (a, b) -> a + 1, (Supplier<Map<Integer, Integer>>) HashMap::new));

        int minOccurrence = map.values()
                          .stream()
                          .reduce(Integer.MAX_VALUE, Math::min);

        for (int i = 2; i <= minOccurrence; i++) {
            int finalI = i;
            if (map.values()
                   .stream()
                   .allMatch(v -> v % finalI == 0)) return true;
        }
        return false;
    }
